import React from 'react';

const Navbar = () => {
  return (
    <nav className="flex justify-between items-center px-8 py-4 text-white bg-dark fixed top-0 w-full z-10 shadow-lg">
      <h1 className="text-3xl font-serif text-gold">Satyansh's Portfolio</h1>
      <ul className="flex gap-6 font-sans text-lg">
        <li><a href="#home" className="nav-link">Home</a></li>
        <li><a href="#about" className="nav-link">About</a></li>
        <li><a href="#projects" className="nav-link">Projects</a></li>
        <li><a href="#resume" className="nav-link">Resume</a></li>
        <li><a href="#contact" className="nav-link">Contact</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
